import React from 'react'
import ApplyCard from './ApplyCard';
import "./opportunity.css";

const ApplyList = ({ apply }) => {

let content;

if(apply.length > 0){

    const resulte = apply.map(apply =><ApplyCard  apply={apply}/>)

    content = resulte?.length ? resulte : <p className="p-Students-Card"> لا يوجد تقديمات حاليا على الفرصة </p>

}else{
    if(apply.length == 0){
    content = <p className="p-Students-Card"> لا يوجد تقديمات حاليا على الفرصة </p> 
    }else{
    const resulte =<ApplyCard  apply={apply}/>
    
    content = resulte;
    }
}


return (
    <div>
        {content}
    </div>
)
}

export default ApplyList
